var request = require('request');
var http = require('http');
var jetpack = require('fs-jetpack');
var dialog = require('dialog');

const electron = require('electron');
const BrowserWindow = electron.BrowserWindow;

var gapi = function() {
    this.corsWindow = null;
    this.config = {};
    this.SCOPES = [
        'https://www.googleapis.com/auth/gmail.modify',
        'https://www.googleapis.com/auth/youtube.readonly'
    ];
}

gapi.prototype.handleRequest = function(req, res) {
    if (req.url == '/') {
        res.setHeader("Content-Type", "text/html; charset=utf-8");
        res.writeHead(200, {
            'Access-Control-Allow-Origin': '*'
        });
        res.write(
            '<html><head><meta charset="UTF-8"></head><body style="text-align: center; background: #EEE;">' +
            '<form name="g" method="post" action="https://accounts.google.com/o/oauth2/v2/auth" style="width: 100%; text-align: center;">' +
                '<input type="hidden" name="client_id" value="' + this.config.client.id + '" />' +
                '<input type="hidden" name="scope" value="' + this.SCOPES.join(' ') + '" />' +
                '<input type="hidden" name="login_hint" value="blipi.tube@gmail.com" />' +
                '<input type="hidden" name="prompt" value="select_account" />' +
                '<input type="hidden" name="response_type" value="code" />' +
                '<input type="hidden" name="access_type" value="offline" />' +
                '<input type="hidden" name="redirect_uri" value="http://localhost:10263/auth/" />' +
            '</form>' +
            '<img onclick="document.forms[\'g\'].submit()" style="transform: translatey(50%); width: 200px" src="data:image/png;base64,"/>' +
            '<script>document.forms["g"].submit();</script>' +
            '</body></html>'
        );
    } else if (req.url.substr(0, 11) == '/auth/?code') {
        this.config.auth = {code: req.url.substr(12)}
        this.corsWindow.close();
    } else {
        this.corsWindow.close();
    }
}

gapi.prototype.initialize = function() {
    var reference = this;

    jetpack.readAsync('config/alerts.json')
    .then(function(data) {
        reference.config = JSON.parse(data);

        var server = http.createServer(function(req, res) { reference.handleRequest(req, res); });

        server.listen(10263, function() {
            console.log('server started at http://localhost:10263');
        });

        reference.corsWindow = new BrowserWindow({
            useContentSize: true,
            frame: false,
            resizable: false,
            hasShadow: false,
            alwaysOnTop: true
        });
        reference.corsWindow.loadURL('http://localhost:10263');

        reference.corsWindow.on('close', function(){
            if (reference.config.auth) {
                request.post({
                    url: 'https://www.googleapis.com/oauth2/v4/token',
                    form:
                        {
                            code: reference.config.auth.code,
                            client_id: reference.config.client.id,
                            client_secret: reference.config.client.secret,
                            redirect_uri: 'http://localhost:10263/auth/',
                            grant_type: 'authorization_code'
                        }
                    }, function(error, response, data) {
                        data = JSON.parse(data);
                        reference.config.auth.access_token = data.access_token;
                        reference.config.auth.refresh_token = data.refresh_token;
                        setTimeout(function() { reference.refreshToken(); }, data.expires_in * 1000);
                    }
                );
            }
        });
    });
}

gapi.prototype.refreshToken = function() {
    request.post({
        url: 'https://www.googleapis.com/oauth2/v4/token',
        form:
            {
                refresh_token: this.config.auth.refresh_token,
                client_id: this.config.client.id,
                client_secret: this.config.client.secret,
                grant_type: 'refresh_token'
            }
        }, function(error, response, data) {
            data = JSON.parse(data);
            this.config.auth.access_token = data.access_token;
            setTimeout(refreshToken, data.expires_in * 1000);
        }
    );
}

gapi.prototype.ready = function() {
    return typeof this.config.auth !== "undefined" && typeof this.config.auth.access_token !== "undefined";
}

gapi.prototype.query = function(args) {
    if (typeof args.method === "string" && args.method == "post") {
        request.post({
                url: args.url + (args.url.indexOf('?') >= 0 ? '&' : '?') + 'access_token=' + this.config.auth.access_token,
                form: args.data,
                body: args.body,
                headers: args.headers
            },
            function(error, response, data){
                args.callback(JSON.parse(data));
            }
        );
    } else {
        request(args.url + (args.url.indexOf('?') >= 0 ? '&' : '?') + 'access_token=' + this.config.auth.access_token, function(error, response, data) {
            args.callback(JSON.parse(data));
        });
    }
}

export var gAPI = gapi;
